import "./DownloadComponent.scss";
import download from "../../assets/icons/download.svg";
import { CSVLink } from "react-csv";

export const DownloadComponent = () => {
  const headers = [
    { label: "order", key: "info.number" },
    { label: "title", key: "" },
    { label: "type", key: "" },
    { label: "answer", key: "" },
  ];

  const data = [
    { info: { number: 1 } },
    { info: { number: 2 } },
    { info: { number: 3 } },
    { info: { number: 4 } },
    { info: { number: 5 } },
    { info: { number: 6 } },
  ];

  return (
    <div className="downloadComponentContainer">
      <CSVLink
        className="CSVButton"
        data={data}
        headers={headers}
        filename=""
        target="_blank"
      >
        <img src={download} />
        <span>Download my answers</span>
      </CSVLink>
    </div>
  );
};
